import React from "react";
import "./hub.css"
import { NavLink } from "react-router-dom"



function Hub() {
  return <>
  <div className="container">
  <button className= "btn1"><NavLink  to="/Homepage1">Temp 1</NavLink></button>
  <button className= "btn"><NavLink  to="/Homepage2">Temp 2</NavLink></button>
  </div>
    
    
  </>
}



export default Hub;
